import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Container, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Box } from '@mui/material';

function PredictionHistory() {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    fetchHistory();
  }, []);

  const fetchHistory = () => {
    axios.get('http://localhost:5000/history')
      .then(response => {
        setHistory(response.data);
      })
      .catch(error => {
        console.error('Error fetching history:', error);
      });
  };

  // Mapping of feature keys to their corresponding display names
  const fieldNames = {
    Pregnancies: 'Pregnancies',
    Glucose: 'Glucose Level',
    BloodPressure: 'Blood Pressure',
    SkinThickness: 'Skin Thickness',
    Insulin: 'Insulin Level',
    BMI: 'Body Mass Index (BMI)',
    DiabetesPedigreeFunction: 'Diabetes Pedigree Function',
    Age: 'Age'
  };

  return (
    <Container maxWidth="lg">
      <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
        <Typography variant="h5" align="center" gutterBottom style={{ fontWeight: 'bold' }}>
          Prediction History
        </Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Index</TableCell>
                <TableCell>Features</TableCell>
                <TableCell>Result</TableCell>
                <TableCell>Date</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {history.map((entry, index) => (
                <TableRow key={index}>
                  <TableCell>{index + 1}</TableCell>
                  <TableCell>
                    <Box>
                      {Object.keys(fieldNames).map((key) => (
                        <Typography key={key} variant="body2">
                          <strong>{fieldNames[key]}:</strong> {entry.features[key] || 'N/A'}
                        </Typography>
                      ))}
                    </Box>
                  </TableCell>
                  <TableCell>{entry.result}</TableCell>
                  <TableCell>{new Date(entry.date).toLocaleString()}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </Container>
  );
}

export default PredictionHistory;
